import { Route, Switch, Redirect } from "react-router-dom";
import MainHeader from "./components/layout/MainNavigation";

function App() {
  return (
    <div>
      <MainHeader />
      <main>
        <Switch>
        <Route path='/' exact> 
            <Redirect to='/welcome' />
          </Route>
          <Route path="/welcome">
            <Welcome />
          </Route>
          <Route path="/choirs" exact>
            <Choirs />
          </Route>

        </Switch>
      </main>
    </div>
  );
}

export default App;
